function extractFirstFourDigits(input) {
    // Regular expression to match the first four digits after [
    const match = input.match(/\[(\d{4})/);
    // If a match is found, return the first capturing group
    return match ? match[1] : null;
}

function extractLastFourDigits(input) {
    // Regular expression to match the last four digits before ]
    const match = input.match(/(\d{4})\]/);
    // If a match is found, return the first capturing group
    return match ? match[1] : null;
}

function updateSelectDates(){
    var unit = document.getElementById("unit").value;
    var end_unit = document.getElementById("end_unit").value;

    var startYear_unit = extractFirstFourDigits(unit);
    var startYear_end_unit = extractFirstFourDigits(end_unit);
    var startYear = startYear_unit;
    var currentYear = extractLastFourDigits(end_unit);

    if (unit === "French franc") startYear = 1795;
    if (unit === "Greek drachma") startYear = 1877;

    console.log(unit,end_unit,startYear_unit,startYear_end_unit,currentYear)

    var s = document.getElementById('start_year');
    s.innerHTML = '';
    for (let year = startYear; year <= currentYear; year++) {
        const option = document.createElement('option');
        option.value = year;
        option.textContent = year;
        s.appendChild(option);
    }
    var e = document.getElementById('end_year');
    e.innerHTML = '';
    for (let year = currentYear; year >= startYear; year--) {
        const option = document.createElement('option');
        option.value = year;
        option.textContent = year;
        e.appendChild(option);
    }
    
}